import React, { useState } from 'react';
import axios from 'axios';

const Form = ({ onPrediction }) => {
  const [formData, setFormData] = useState({
    depTime: '',
    crsArrTime: '',
    TaxiIn: 0,
    TaxiOut: 0,
    CarrierDelay: 0,
    WeatherDelay: 0,
    NASDelay: 0,
    LateAircraftDelay: 0,
  });

  const [error, setError] = useState('');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const convertTimeToMinutes = (time) => {
    const [hours, minutes] = time.split(':').map(Number);
    return hours * 60 + minutes;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const transformedData = {
        ...formData,
        DepTime: convertTimeToMinutes(formData.depTime),
        CRSArrTime: convertTimeToMinutes(formData.crsArrTime),
      };

      const response = await axios.post('http://localhost:8000/predict', transformedData);
      onPrediction(response.data);
    } catch (err) {
      setError('Error processing prediction. Please try again.');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Flight Delay Prediction</h2>
      {error && <p style={{ color: 'red' }}>{error}</p>}

      <div>
        <label>Departure Time</label>
        <input
          name="depTime"
          type="time"
          onChange={handleChange}
          required
        />
      </div>

      <div>
        <label>Scheduled Arrival Time</label>
        <input
          name="crsArrTime"
          type="time"
          onChange={handleChange}
          required
        />
      </div>

      <div>
        <label>Taxi In Time (Minutes)</label>
        <input
          name="TaxiIn"
          type="number"
          min="0"
          placeholder="Taxi In Time"
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Taxi Out Time (Minutes)</label>
        <input
          name="TaxiOut"
          type="number"
          min="0"
          placeholder="Taxi Out Time"
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Carrier Delay (Minutes)</label>
        <input
          name="CarrierDelay"
          type="number"
          min="0"
          placeholder="Carrier Delay"
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Weather Delay (Minutes)</label>
        <input
          name="WeatherDelay"
          type="number"
          min="0"
          placeholder="Weather Delay"
          onChange={handleChange}
        />
      </div>

      <div>
        <label>NAS Delay (Minutes)</label>
        <input
          name="NASDelay"
          type="number"
          min="0"
          placeholder="NAS Delay"
          onChange={handleChange}
        />
      </div>

      <div>
        <label>Late Aircraft Delay (Minutes)</label>
        <input
          name="LateAircraftDelay"
          type="number"
          min="0"
          placeholder="Late Aircraft Delay"
          onChange={handleChange}
        />
      </div>

      <button type="submit">Predict</button>
    </form>
  );
};

export default Form;
